import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './Common/header/header.component';
import { FooterComponent } from './Common/footer/footer.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { CommonTabsComponent } from './Common/tabs/common-tabs.component';
import {MatMenuModule} from '@angular/material/menu';
import { OrganizationalAccountComponent } from './AllComponents/organizational-account/organizational-account.component';
import { CommonPopupComponent } from './Common/popup/common-popup.component';
import { ProjectListingDefaultComponent } from './AllComponents/project-listing-default/project-listing-default.component';
import { ProjectCreationFormComponent } from './AllComponents/project-creation-form/project-creation-form.component';
import { ToastMessagesComponent } from './Common/toast-messages/toast-messages.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    CommonTabsComponent,
    OrganizationalAccountComponent,
    CommonPopupComponent,
    ProjectListingDefaultComponent,
    ProjectCreationFormComponent,
    ToastMessagesComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
